class LoginResponse {  final int? status;  final String? message;  final String? accessToken;  final String? tokenType;  final int? expiresIn;  LoginResponse({    this.status,    this.message,    this.accessToken,    this.tokenType,    this.expiresIn,  });  factory LoginResponse.fromJson(Map<String, dynamic> json) {    return LoginResponse(      status: json['status'] as int?,      message: json['message'] as String?,      accessToken: json['access_token'] as String?,      tokenType: json['token_type'] as String?,      expiresIn: json['expires_in'] as int?,    );  }  Map<String, dynamic> toJson() {    return {      'status': status,      'message': message,      'access_token': accessToken,      'token_type': tokenType,      'expires_in': expiresIn,    };  }}